import React from "react";
import sliderPasionero from "./fotos";

// Import Swiper React components
import { Swiper, SwiperSlide } from "swiper/react";
// Import Swiper styles
import "swiper/swiper.min.css";
import "swiper/components/effect-cube/effect-cube.min.css";
import "swiper/components/pagination/pagination.min.css";
import SwiperCore, { EffectCube, Pagination } from "swiper";
SwiperCore.use([EffectCube, Pagination]);

//import "./styles"
//<div className='divSwiper'></div>

export default function Pasionario() {

  return (
    <div className='divComponente'>
    <h2>Morrison</h2>
    <h3>Desliza para mas imagenes</h3>
    <section>
    <div className='divSwiper'></div>
      <Swiper
      effect={"cube"}
      grabCursor={true}
      cubeEffect={{
        shadow: true,
        slideShadows: true,
        shadowOffset: 20,
        shadowScale: 0.94,
      }}

      pagination={true}
      className="mySwiper"
      >

      {sliderPasionero.map((item, index) => {
        return (
          <div

          >
            {<SwiperSlide><img src={item} alt='slider' className="image"></img></SwiperSlide>}
          </div>
        );
      })}
      </Swiper>
    </section>
  </div>
  );
}
